(42, 1, '2021-12-17 16:42:29', '2021-12-17 13:42:29', 'Брус — пиломатериал толщиной и шириной 100 мм и более. Брусья изготовляются из брёвен или клееных досок. Используются в строительстве домов, в мебельной промышленности, производстве тары и др.\r\n\r\nВ зависимости от опиленности сторон:\r\n\r\nДвухкантный брус (лафет) — брус с двумя противоположными обработанными поверхностями.\r\nТрёхкантный брус — брус, имеющий три продольные обработанные поверхности.\r\nЧетырёхкантный брус — брус, имеющий четыре продольные обработанные поверхности.\r\nВ зависимости от обеспечения точности и стабильности размеров. Равные стороны поперечного сечения.\r\n\r\nКалиброванный брус — брус, высушенный и обработанный до заданного размера.', 'Брус 3 метра', '<table>\r\n<tr>Подробная информация</tr>\r\n<tr>\r\n   <td>Вид доски</td>\r\n   <td><b>Брус</b></td>\r\n</tr>\r\n<tr>\r\n   <td>Порода древесины</td>\r\n   <td><b>Cосна</b></td>\r\n</tr>\r\n<tr>\r\n   <td>Сорт</td>\r\n   <td><b>1-й</b></td>\r\n</tr>\r\n<tr>\r\n   <td>Влажность</td>\r\n   <td><b>Естественная</b></td>\r\n</tr>\r\n\r\n</table>', 'publish', 'open', 'closed', '', 'brus-3m', '', '', '2022-01-04 22:20:42', '2022-01-04 19:20:42', '', 0, 'http://localhost/?post_type=product&#038;p=42', 0, 'product', '', 2),
