(79, 1, '2021-12-17 17:09:47', '2021-12-17 14:09:47', 'Брус — пиломатериал толщиной и шириной 100 мм и более. Брусья изготовляются из брёвен или клееных досок. Используются в строительстве домов, в мебельной промышленности, производстве тары и др.\r\n\r\nВ зависимости от опиленности сторон:\r\n\r\nДвухкантный брус (лафет) — брус с двумя противоположными обработанными поверхностями.\r\nТрёхкантный брус — брус, имеющий три продольные обработанные поверхности.\r\nЧетырёхкантный брус — брус, имеющий четыре продольные обработанные поверхности.\r\nВ зависимости от обеспечения точности и стабильности размеров. Равные стороны поперечного сечения.\r\n\r\nКалиброванный брус — брус, высушенный и обработанный до заданного размера.', 'Брус 4 метра', '<table>\r\n<tr>\r\n   <th>Подробная информация</th>\r\n</tr>\r\n<tr>\r\n   <td>Вид доски</td>\r\n   <td><b>Брус</b></td>\r\n</tr>\r\n<tr>\r\n   <td>Порода древесины</td>\r\n   <td><b>Cосна</b></td>\r\n</tr>\r\n<tr>\r\n   <td>Сорт</td>\r\n   <td><b>1-й</b></td>\r\n</tr>\r\n<tr>\r\n   <td>Влажность</td>\r\n   <td><b>Естественная</b></td>\r\n</tr>\r\n<tr>\r\n   <td>Количество досок в куб.м.</td>\r\n   <td><b>33 шт.</b></td>\r\n</tr>\r\n</table>', 'publish', 'open', 'closed', '', '%d0%b1%d1%80%d1%83%d1%81-3-%d0%bc%d0%b5%d1%82%d1%80%d0%b0-%d0%ba%d0%be%d0%bf%d0%b8%d1%80%d0%be%d0%b2%d0%b0%d1%82%d1%8c-%d0%ba%d0%be%d0%bf%d0%b8%d1%80%d0%be%d0%b2%d0%b0%d1%82%d1%8c-%d0%ba%d0%be-2', '', '', '2021-12-28 01:46:28', '2021-12-27 22:46:28', '', 0, 'http://localhost/?post_type=product&#038;p=79', 0, 'product', '', 0),
