(117, 1, '2021-12-28 01:45:06', '2021-12-27 22:45:06', 'Брус — пиломатериал толщиной и шириной 100 мм и более. Брусья изготовляются из брёвен или клееных досок. Используются в строительстве домов, в мебельной промышленности, производстве тары и др.', 'Брус 4 метра', '<table>\n<tr>\n   <th>Подробная информация</th>\n</tr>\n<tr>\n   <td>Вид доски</td>\n   <td><b>Брус</b></td>\n</tr>\n<tr>\n   <td>Порода древесины</td>\n   <td><b>Cосна</b></td>\n</tr>\n<tr>\n   <td>Сорт</td>\n   <td><b>1-й</b></td>\n</tr>\n<tr>\n   <td>Влажность</td>\n   <td><b>Естественная</b></td>\n</tr>\n<tr>\n   <td>Количество досок в куб.м.</td>\n   <td><b>33 шт.</b></td>\n</tr>\n</table>', 'inherit', 'closed', 'closed', '', '79-autosave-v1', '', '', '2021-12-28 01:45:06', '2021-12-27 22:45:06', '', 79, 'http://localhost/?p=117', 0, 'revision', '', 0),
