(120, 1, '2021-12-26 13:54:57', '2021-12-26 10:54:57', '{\n    \"site_icon\": {\n        \"value\": 119,\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2021-12-26 10:54:18\"\n    },\n    \"pilomaterialy::custom_logo\": {\n        \"value\": \"\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2021-12-26 10:54:18\"\n    }\n}', '', '', 'trash', 'closed', 'closed', '', 'e9318c73-28a0-4357-8fbf-3a8f622b9fc2', '', '', '2021-12-26 13:54:57', '2021-12-26 10:54:57', '', 0, 'http://localhost/?p=120', 0, 'customize_changeset', '', 0),
(121, 1, '2021-12-26 19:26:46', '2021-12-26 16:26:46', 'Обрезная доска — пиломатериал размерами сечений от 16 × 8 мм до 250 × 100 мм. Обрезные доски изготавливаются из древесины разных пород. Основное отличие обрезной доски — это наличие обзола, не более допустимого по соответствующей нормативно-технической документации.\r\nРазмеры\r\nРазмеры обрезной доски определяют по схеме a × b × l, где b — вычисляется как бо́льшая сторона поперечного среза, размер a — меньшая сторона, l — длина доски, например, 50×150×6000 мм.\r\n\r\n\r\nНаиболее распространена доска следующих длин: 6000 мм, 4000 мм, 3000 мм.\r\n\r\nНа территории России наиболее распространена доска толщиной (параметр «a»): 22 мм, 25 мм, 30 мм, 40 мм, 50 мм, 100 мм, 150 мм.\r\n\r\nОбрезную доску другой толщины исполняют из пиломатериалов стандартного размера методом продольного распила, строганием и пр.\r\n\r\nОбрезную доску, у которой отношение стороны b к a равно двум и менее, называют брусом. Например, брус 100×100×6000 мм или брус 70×90×3000 мм.\r\n\r\nТипы досок\r\nБывает несколько типов обрезной доски. Основные отличия:\r\n\r\nВлажность:\r\nсырые (влажность более 22 %);\r\nсухие (влажность менее 22 %);\r\nсырые антисептированые.\r\nСорт. По ГОСТ 8486-86 существует несколько сортов обрезной доски:\r\nотборный сорт (судостроение, автомобилестроение);\r\nпервый сорт (судостроение, автостроение, мебель, строительство);\r\nвторой сорт (судостроение, автостроение, мебель, строительство);\r\nтретий сорт (автостроениечто это?, мебель, строительство, тара и упаковка);\r\nчетвёртый сорт (тара и упаковка, малоответственные детали).', 'Доска обрезная 3м', '<table>\r\n<tr>Подробная информация</tr>\r\n<tr>\r\n   <td>Вид доски</td>\r\n   <td><b>Доска обрезная</b></td>\r\n</tr>\r\n<tr>\r\n   <td>Порода древесины</td>\r\n   <td><b>Cосна</b></td>\r\n</tr>\r\n<tr>\r\n   <td>Сорт</td>\r\n   <td><b>1-й</b></td>\r\n</tr>\r\n<tr>\r\n   <td>Влажность</td>\r\n   <td><b>Естественная</b></td>\r\n</tr>\r\n\r\n</table>', 'publish', 'open', 'closed', '', '%d0%b4%d0%be%d1%81%d0%ba%d0%b0-%d0%be%d0%b1%d1%80%d0%b5%d0%b7%d0%bd%d0%b0%d1%8f-3%d0%bc', '', '', '2021-12-28 02:04:11', '2021-12-27 23:04:11', '', 0, 'http://localhost/?post_type=product&#038;p=121', 0, 'product', '', 2),
(129, 1, '2021-12-26 21:40:06', '2021-12-26 18:40:06', 'До́шка обрізна́ — це пиломатеріал розмірами від 16×8 мм до 250×100 мм в ширину і висоту відповідно. Обрізна дошка виготовляється з деревини різних порід. Основна відмінність обрізної дошки — це відсутність обзелу (краю дошки з корою, коли її випилюють з колоди). За стандартом дозволений невеликий обзел, але його значення мінімальне і строго нормоване.', 'Брус 3 метра 1', '<table>\r\n<tr>Подробная информация</tr>\r\n<tr>\r\n   <td>Вид доски</td>\r\n   <td><b>Брус</b></td>\r\n</tr>\r\n<tr>\r\n   <td>Порода древесины</td>\r\n   <td><b>Cосна</b></td>\r\n</tr>\r\n<tr>\r\n   <td>Сорт</td>\r\n   <td><b>1-й</b></td>\r\n</tr>\r\n<tr>\r\n   <td>Влажность</td>\r\n   <td><b>Естественная</b></td>\r\n</tr>\r\n<tr>\r\n   <td>Количество досок в куб.м.</td>\r\n   <td><b>33 шт.</b></td>\r\n</tr>\r\n</table>', 'trash', 'open', 'closed', '', '%d0%b1%d1%80%d1%83%d1%81-3-%d0%bc%d0%b5%d1%82%d1%80%d0%b0-1__trashed', '', '', '2021-12-26 22:30:01', '2021-12-26 19:30:01', '', 0, 'http://localhost/?post_type=product&#038;p=129', 0, 'product', '', 0),
